import React from "react";
import { Navbar } from "../index";
import "./CreateShipment.css";
import axios from "axios";

class CreateShipment extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      parcel_ID: "1",
      RecipientName: "",
      parcel_sender: "",
      parcel_receiver: "",
      shipping_cost: "",
      type: "",
      weight: "",
      Province_Origin: "",
      Province_Destination: "",
      provinces: [],
    };
  }

  componentDidMount() {
    this.fetchProvinces();
  }

  fetchProvinces = () => {
    fetch("http://localhost:3333/Shipping")
      .then((response) => response.json())
      .then((data) => {
        if (data.status === "ok") {
          this.setState({ provinces: data.provinces });
        } else {
          console.error("Error fetching provinces:", data.message);
        }
      })
      .catch((error) => {
        console.error("Error fetching provinces:", error);
      });
  };

  handleSubmit = async (e) => {
    e.preventDefault();
    // Implement submission logic
  };

  handleChange = (e) => {
    this.setState({ [e.target.name]: e.target.value });
  };

  render() {
    return (
      <>
        <Navbar />
        <div className="Create-container" id="container">
          <div className="Create-form-container">
            <form onSubmit={this.handleSubmit}>
              <h1>Create Shipment</h1>
              <span>Enter shipment information to create shipment</span>
              <br />
              <div className="form-group row">
                <label
                  htmlFor="RecipientName"
                  className="col-sm-4 col-form-label"
                >
                  <span className="lb_IDCard">Recipient name</span>
                </label>
                <div className="enterdata">
                  <input
                    name="RecipientName"
                    value={this.state.RecipientName}
                    onChange={this.handleChange}
                    type="text"
                    placeholder="Enter recipient name"
                  />
                </div>
              </div>
              {/* Other form fields */}
              <div className="form-group row">
                <label
                  htmlFor="Province_Origin"
                  className="col-sm-4 col-form-label"
                >
                  <span className="lb_IDCard">
                    Origin Province/District/Sub-district/zip code
                  </span>
                </label>
                <div className="enterdata">
                  <select
                    name="Province_Origin"
                    value={this.state.Province_Origin}
                    onChange={this.handleChange}
                  >
                    <option value="">Select Origin Province</option>
                    {this.state.provinces.map((province) => (
                      <option key={province.code} value={province.code}>
                        {province.name_th}
                      </option>
                    ))}
                  </select>
                </div>
              </div>
              <div className="form-group row">
                <label
                  htmlFor="Province_Destination"
                  className="col-sm-4 col-form-label"
                >
                  <span className="lb_IDCard">
                    Destination Province/District/Sub-district/zip code
                  </span>
                </label>
                <div className="enterdata">
                  <select
                    name="Province_Destination"
                    value={this.state.Province_Destination}
                    onChange={this.handleChange}
                  >
                    <option value="">Select Destination Province</option>
                    {this.state.provinces.map((province) => (
                      <option key={province.code} value={province.code}>
                        {province.name_th}
                      </option>
                    ))}
                  </select>
                </div>
              </div>
              {/* Other form fields */}
              <button type="submit">Submit</button>
            </form>
          </div>
        </div>
      </>
    );
  }
}

export default CreateShipment;
